import React from 'react'

export default function ImageSearch({handleChange}) {
    return (
        <div>
                <form onSubmit={handleSubmit}>
                <input type='text' placeholder='Search Value..' name='searchValue' onChange={handleChange}/>
                <button>Search</button>
                </form>
               
        </div>
    )
}
